package ru.zentsova.yandex.sprint4

import org.assertj.core.api.Assertions.assertThat
import org.junit.jupiter.params.ParameterizedTest
import org.junit.jupiter.params.provider.Arguments
import org.junit.jupiter.params.provider.Arguments.arguments
import org.junit.jupiter.params.provider.MethodSource
import java.util.stream.Stream

class DKtTest {

	@ParameterizedTest
	@MethodSource("stringsProvider")
	fun polynomialHash(string: String, a: Int, m: Int, expected: Int) {
		val actual = polynomialHash(string, a, m)
		assertThat(actual).isEqualTo(expected)
	}

	companion object {
		@JvmStatic
		fun stringsProvider(): Stream<Arguments> {
			return Stream.of(
				arguments("a", 123, 100003, 97),
				arguments("hash", 123, 100003, 6080),
				arguments("HaSH", 123, 100003, 56156),
				arguments("", 357, 575704498, 445305197),
			)
		}
	}
}